const {notes, times} = midToNotes(mid);

function midToNotes(mid){
  const tracks = [];
  const map = {}
  mid.tracks.forEach(k=>{
    const items = k.notes;
    items.forEach(item=>{
      const time = item.time;
      let chord = map[time];
      if(chord){
        chord.push({
          name: item.name,
          duration:item.duration,
          velocity: item.velocity
        })
      }
      else{
        map[time] = [{
          name: item.name,
          duration:item.duration,
          velocity: item.velocity
        }]
      }
      
    })
  })
  const notes = [];
  const times =[];
  // console.log(map, 2323)
  let keyArr =   Object.keys(map).sort(function(a, b)   {        
    return (+a) - (+b);   //升序
  });
  for(let k of keyArr){
    notes.push(map[k])
    times.push(k)
  }
  console.log(times)
  return {notes, times}
}

